import './VideoItem.css';
import React from 'react';

const VideoItem = ({video}) => {
    console.log(video);
    return (
        <div className="vide-item item">
            <img className="ui image" alt={video.snippet.channelTitle} src={video.snippet.thumbnails.medium.url}/>
            <div className="content">
                <div className="header">
                    {video.snippet.title}
                </div>
            </div>
        </div>
    )
};

export default VideoItem;
